How to solve "Cannot read property 'title' of undefined"?<p>I am using Postman to learn about APIs. The contents of my server.js file is in the code below. However, when I send a post through Postman, the error "Cannot read property 'title' of undefined" keeps showing. </p>

<pre><code>var Product = require("./model/product");
var WishList = require("./model/wishlist");

app.post("/product", function (request, response) {
  var product = new Product();
  product.title = request.body.title;
  product.price = request.body.price;
  product.save(function (err, savedProduct) {
    if (err) {
      response.status(500).send({ error: "Could not save product" });
    } else {
      response.status(200).send(savedProduct);
    }
  });
});

app.use(express.json());
app.use(bodyParser.json());
app.use(bodyParser.urlencoded({ extended: false }));

app.listen(3000, function () {
  console.log("Swag Shop API runing on port 3000...");
});

</code></pre>

<p>The product.js file contains the code below. </p>

<pre><code>var mongoose = require("mongoose");
var Schema = mongoose.Schema;

var product = new Schema({
  title: String,
  price: Number,
  likes: { type: Number, default: 0 },
});

module.exports = mongoose.model("Product", product);

</code></pre>

<p>I tried to send the following json file through Postman but then the errorType: "Cannot read property 'title' of undefined " was showing. </p>

<pre><code>{
    "title": "Test Title",
    "price": 100.00
}
</code></pre>

<p>These are the folders to see the location of my files: <a href="https://i.stack.imgur.com/wAgn0.jpg" rel="nofollow noreferrer">Folders</a>.</p>

<p>This <a href="https://stackoverflow.com/questions/57094654/how-to-fix-typeerror-cannot-read-property-title-of-undefined-in-javascript?answertab=active#tab-top">solution</a> using <code>npm install express@"&gt;=3.0.0 &lt;4.0.0" --save</code> did not work in my case. After I used it in my terminal, the same error kept showing. </p>

<p>How can I solve this issue? </p>

