Build MongoDB filter expression from field expression: `Expression<Func<T, string>>` to `Expression<Func<T, bool>>`<p>I am writing a generic service that for a <code>T</code> should find a record in a mongodb database based on the supplied id field <code>Expression&lt;Func&lt;T, string&gt;&gt;</code>. </p>

<p>The model look something like this:</p>

<pre><code>struct TestEntity{
    public string Id { get; set; }
}
</code></pre>

<p>the service looks something like this:</p>

<pre><code>class Repository&lt;T&gt; {
    private readonly Expression&lt;Func&lt;T, string&gt;&gt; _idField;
    private readonly IMongoCollection&lt;T&gt; _collection;

    public Repository(Expression&lt;Func&lt;T, string&gt;&gt; idField, IMongoCollection&lt;T&gt; collection)
    {
        _idField= idField;
        _collection = collection;
    }

    public T Find(string id) {
        Func&lt;T, string&gt; idAccessor = _idField.Compile();
        FilterDefinition&lt;T&gt; filter = new ExpressionFilterDefinition&lt;T&gt;(
            // the mongodb filter takes an Expression&lt;Func&lt;T, bool&gt;&gt;
            entity =&gt; idAccessor(entity) == id);
        return _collection.Find(filter).First();
    }
}
</code></pre>

<p>However, mongodb seems to not be able to properly handle that expression. I get the following error:</p>

<blockquote>
  <p>System.InvalidOperationException : Invoke(value(System.Func`2[TestEntity,System.String]), {document}) is not supported.</p>
</blockquote>

<p>I suspect I cannot compile the id expression to a function and just use that to build another expression. If that is true, then my question is how would I turn the <code>Expression&lt;Func&lt;T, string&gt;&gt;</code> into an <code>Expression&lt;Func&lt;T, bool&gt;&gt;</code>?</p>

